DROP TABLE IF EXISTS holiday;

CREATE TABLE `holiday` (
  `entryNo` int(50) NOT NULL AUTO_INCREMENT,
  `HolidayName` varchar(150) NOT NULL,
  `date` date NOT NULL,
  `period` varchar(50) NOT NULL,
  PRIMARY KEY (`entryNo`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS image;

CREATE TABLE `image` (
  `employeeNo` varchar(50) NOT NULL,
  `image` longtext,
  PRIMARY KEY (`employeeNo`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS leaveentry;

CREATE TABLE `leaveentry` (
  `entryId` int(50) NOT NULL AUTO_INCREMENT,
  `employeeNo` int(50) NOT NULL,
  `leaveType` varchar(50) NOT NULL,
  `dateFrom` varchar(50) NOT NULL,
  `dateTo` varchar(50) NOT NULL,
  `duration` varchar(50) NOT NULL,
  `status` varchar(50) NOT NULL DEFAULT 'PENDING',
  PRIMARY KEY (`entryId`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS leavetype;

CREATE TABLE `leavetype` (
  `LeaveTypeCode` varchar(30) NOT NULL,
  `LeaveTypeDescription` varchar(150) DEFAULT NULL,
  `Category` varchar(30) DEFAULT NULL,
  `Status` enum('Active','Deleted') DEFAULT 'Active',
  PRIMARY KEY (`LeaveTypeCode`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS officialbusiness;

CREATE TABLE `officialbusiness` (
  `entryId` int(50) NOT NULL AUTO_INCREMENT,
  `employeeNo` int(50) NOT NULL,
  `fullname` varchar(100) NOT NULL,
  `datefrom` varchar(50) NOT NULL,
  `dateto` varchar(50) NOT NULL,
  `duration` varchar(50) NOT NULL,
  `obtype` varchar(50) NOT NULL,
  `details` varchar(500) NOT NULL,
  `status` varchar(50) NOT NULL,
  PRIMARY KEY (`entryId`)
) ENGINE=InnoDB AUTO_INCREMENT=387 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS position;

CREATE TABLE `position` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `description` varchar(150) NOT NULL,
  `rate` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS user;

CREATE TABLE `user` (
  `userId` int(50) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL,
  `upass` varchar(500) NOT NULL,
  `firstName` varchar(50) NOT NULL,
  `lastName` varchar(50) NOT NULL,
  `userType` varchar(50) NOT NULL,
  `Status` varchar(50) NOT NULL DEFAULT 'Active',
  PRIMARY KEY (`userId`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS workschedule;

CREATE TABLE `workschedule` (
  `workScheduleId` varchar(30) NOT NULL,
  `workScheduleDescription` varchar(200) DEFAULT NULL,
  `remarks` varchar(200) DEFAULT NULL,
  `status` enum('Active','Deleted') DEFAULT 'Active',
  PRIMARY KEY (`workScheduleId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

